import React, { Component } from 'react';
import MaterialIcon, {colorPalette} from 'material-icons-react';
import './desktop.css';

class Option extends Component {	
  	render() {
  	  	return (
  				  <li id="pestana0" status="enable">
  				     <a href={this.props.destino}>
  				        <div class="LiIcon"><MaterialIcon class="material-icons" icon={this.props.icono} invert /></div>
  				        <div class="LiTitle">{this.props.titulo}</div>
  				        <div class="LiDescrip">Indicadores de uso del aplicativo</div>
  				     </a>
  				  </li>  				
			  );
  	}
}

export default Option
